import React from 'react';
import Navbar from '../components/header/Navbar';
import Main from '../components/Main';
import Footer from '../components/footer/Footer';
import DeliveryCollections from '../components/Delivery/DeliveryCollection/DeliveryCollections';
import {bobs_tacos} from "../assests/bobs_taco.jpg"

const Home = () => {
  return (
    <>
      <Navbar/>
      <Main 

        title="Your Taste Our Service"
        text="Dear Foody is a online delivery web app where you can find your tasty food easily!"
        buttonText="Get Started"
        url="/item"
        btnclass="show"
      />
      <DeliveryCollections />
      <Footer />
    </>
  )
};

export default Home;
